import React from 'react';
import { withTranslation } from 'react-i18next';
import { print } from './pdf/PrintPdfLogbook';
import { PDFDownloadLink } from 'react-pdf';
import PdfLogbook from './pdf/PdfLogbook';

class PDFTableButton extends React.Component {
    constructor(props) {
        super(props);

        this.onClick = this.onClick.bind(this);
    }

    onClick() {
        return (
            <PDFDownloadLink document={<PdfLogbook />} fileName="somename.pdf">

            </PDFDownloadLink>
        );
    }

    render() {
        return (
            <button className="btn btn-primary"
                onClick={this.onClick}
            >
                PDF
            </button>
        );
    }
}

export default withTranslation("common")(PDFTableButton);
